import { Box, Container, Typography, List, ListItem, ListItemText } from '@mui/material';

const contactInfo = [
  { label: 'Main Location:', value: '32, Main Street LA' },
  { label: 'Enrollment Phone:', value: '(555)-555-5585' },
  { label: 'Student Phone:', value: '(888)-888-8888' },
  { label: 'Enrollment Email:', value: 'abc@gmail.com' },
  { label: 'Student Email:', value: 'xyz@gmail.com' },
];

 export const Contact = () => {
  return (
    <Box component="section" sx={{ py: 5 }}>
      <Container sx={{ width: '75%' }}>
        <Typography variant="h4" align="center" gutterBottom>
          Contact Info
        </Typography>
        <Box display="flex" justifyContent="center">
          <List sx={{ width: '100%'}}>
            {contactInfo.map((info, index) => (
              <ListItem key={index} sx={{ display: 'flex', justifyContent: 'space-between',  py: 1 , boxShadow: '0px 2px 0px rgba(0, 0, 0, 0.1)',  }}>
                <ListItemText
                  primary={
                    <Typography sx={{ fontWeight: 'bold'  , display: 'inline', mr: 2}} component="span">
                      {info.label}
                    </Typography>
                  }
                />
                <Typography>{info.value}</Typography>
              </ListItem>
            ))}
          </List>
        </Box>
      </Container>
    </Box>
  );
};
